-- LIMPA DUPLICADOS
DELETE FROM EQUIPMENTS_TYPE  WHERE ETY_ID IN (SELECT MAX(ETY_ID) AS ETY_ID FROM EQUIPMENTS_TYPE WHERE ETY_DESCRIPTION IS NOT NULL GROUP BY ETY_DESCRIPTION HAVING COUNT(*) > 1 ORDER BY COUNT(*) DESC);
DELETE FROM EQUIPMENTS_MODEL WHERE EMO_ID IN (SELECT MAX(EMO_ID) AS EMO_ID FROM EQUIPMENTS_MODEL WHERE EMO_DESCRIPTION IS NOT NULL GROUP BY EMO_DESCRIPTION HAVING COUNT(*) > 1 ORDER BY COUNT(*) DESC);
DELETE FROM EQUIPMENTS_MANUFACTURER WHERE EMA_ID IN (SELECT MAX(EMA_ID) AS ETY_ID FROM EQUIPMENTS_MANUFACTURER WHERE EMA_DESCRIPTION IS NOT NULL GROUP BY EMA_DESCRIPTION HAVING COUNT(*) > 1 ORDER BY COUNT(*) DESC);
DELETE FROM SITES WHERE SIT_ID IN (SELECT MAX(SIT_ID) AS SIT_ID FROM SITES WHERE SIT_SHORTNAME IS NOT NULL GROUP BY SIT_SHORTNAME HAVING COUNT(*) > 1 ORDER BY COUNT(*) DESC);

